import React, { useState } from "react";

// Ïû¨Í∑Ä Ìä∏Î¶¨ Ïª¥Ìè¨ÎÑåÌä∏ + Ï†ëÍ∏∞/ÌéºÏπòÍ∏∞ Í∏∞Îä•
const PageTree = ({ page, depth = 0 }) => {
  const [expanded, setExpanded] = useState(false);

  const hasChildren = page.pages && page.pages.length > 0;

  return (
    <div style={{ paddingLeft: depth * 20 }}>
      <span
        onClick={() => setExpanded(!expanded)}
        style={{ cursor: hasChildren ? "pointer" : "default", fontWeight: "bold" }}
      >
        {hasChildren ? (expanded ? "üìÇ" : "üìÅ") : "üìÑ"} {page.name}
      </span>

      {expanded && hasChildren && (
        <div>
          {page.pages.map((subPage) => (
            <PageTree key={subPage.id} page={subPage} depth={depth + 1} />
          ))}
        </div>
      )}
    </div>
  );
};

const findNodeById = (nodes, targetId) => {
  for (const node of nodes) {
    if (node.id === targetId) return node;
    if (node.pages && node.pages.length > 0) {
      const found = findNodeById(node.pages, targetId);
      if (found) return found;
    }
  }
  return null;
};

const DocumentSubtreeFromId = ({ data, targetId }) => {
  const root = findNodeById(data, targetId);
  if (!root) return <p>‚ùå Ìï¥Îãπ IDÎ•º Ï∞æÏùÑ Ïàò ÏóÜÏäµÎãàÎã§.</p>;

  return (
    <div>
      <h3>üß∑ ÏãúÏûë ÎÖ∏Îìú: {root.name}</h3>
      <PageTree page={root} />
    </div>
  );
};

